import React from 'react';
import "./SignUpPage.css";

const SignUpPage = () => {
  return (
    <div className="signuppage">
      <div className="div53">회원가입</div>
      <div className="div54">{`운동뭉치의 다양한 서비스를 경험해보세요 `}</div>
      <div className="editable" contentEditable="true">이름</div>
      <div className="editable" contentEditable="true">비밀번호</div>
      <div className="editable" contentEditable="true">비밀번호 확인</div>
      <div className="editable" contentEditable="true">닉네임</div>
      <div className="editable" contentEditable="true">아이디</div>
      <div className="editable" contentEditable="true">부분1</div>
      <div className="editable" contentEditable="true">부분2</div>
      <div className="editable" contentEditable="true">부분3</div>
      <div className="editable" contentEditable="true">부분4</div>
      <div className="editable" contentEditable="true">부분5</div>
      <div className="div60">{`중복확인 `}</div>
      <div className="editable" contentEditable="true">******</div>
      <div className="editable" contentEditable="true">******</div>
      <div className="div63">{`간편 회원가입 `}</div>
      <div className="signuppage-child6" />
      <img className="kakao-login-1-icon1" alt="" src="/kakao-login-1@2x.png" />
      <div className="div64">{`가입하기 `}</div>
    </div>
  );
};

export default SignUpPage;
